      title1:'LEARN MORE'
    },
    {
      id: 2,
      title: 'Shop Our Products!',
      title1:'SHOP'
    },
    {
      id: 3,
      title: 'What Should I Buy?',
      title1:'LEARN MORE'
    },
    {
      id: 4,
      title: 'Madcap University',
      title1:'LEARN MORE'
    },

  ];
  return (
    <div className='categories-container'>
    {categories.map((category) => (
      <CategoryItem key={category.id} category={category} />
    ))}
  </div>

  );
}

export default App;
